import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    /*<div className="App">
      <h1>hello</h1>
    </div>*/
    <div>
      <Routes>
        <Route path="/" components={Home} />
      </Routes>
    </div>
  );
}

export default App;
